class Solution(object):
    def maxKilledEnemies(self, grid):
        """
        :type grid: List[List[str]]
        :rtype: int
        """

        m = len(grid)
        if m == 0:
            return 0
        n = len(grid[0])

        maxcount = 0

        # for i in range(m):
        #     for j in range(n):
        #         if grid[i][j] == '0':
        #             count = 0
        #             for inci,incj in [(-1,0), (1,0), (0,-1), (0,1)]:
        #                 bi, bj = i + inci, j + incj
        #                 while 0 <= bi and bi < m and 0 <= bj and bj < n and grid[bi][bj] != 'W':
        #                     if grid[bi][bj] == 'E':
        #                         count += 1
        #                     bi += inci
        #                     bj += incj
        #
        #
        #             maxcount = max(maxcount, count)

        rowhits = 0
        colhits = [0] * n

        for i in range(m):
            for j in range(n):

                if j == 0 or grid[i][j - 1] == 'W':
                    rowhits = 0
                    k = j
                    while k < n and grid[i][k] != 'W':
                        rowhits += 1 if grid[i][k] == 'E' else 0
                        k += 1

                if i == 0 or grid[i-1][j] == 'W':
                    colhits[j] = 0
                    k = i
                    while k < m and grid[k][j] != 'W':
                        colhits[j] += 1 if grid[k][j] == 'E' else 0
                        k += 1

                if grid[i][j] == '0':
                    maxcount = max(maxcount, rowhits + colhits[j])

        return maxcount

a = Solution()
print(a.maxKilledEnemies([""]))
print(a.maxKilledEnemies(['0E00', 'E0WE', '0E00']))
